import React, { useState, useEffect } from "react";
import { useNavigate } from "react-router-dom";
import {
  FaUser,
  FaClipboardList,
  FaBriefcase,
  FaHistory,
  FaUndoAlt,
  FaSignOutAlt,
  FaBars,
} from "react-icons/fa";
import bookGif from "./gif/book.gif"; // Replace with actual paths to your GIFs
import notesGif from "./gif/notes.gif";
import researchGif from "./gif/research.gif";
import "./UserHome.css";

const UserHome = () => {
  const navigate = useNavigate();
  const [isSidebarVisible, setSidebarVisible] = useState(false);
  const [isHovered, setIsHovered] = useState({});
  const [resources, setResources] = useState([]);

  useEffect(() => {
    fetch("http://localhost:8080/api/resources")
      .then((response) => response.json())
      .then((data) => setResources(data))
      .catch((error) => console.error("Error fetching resources:", error));
  }, []);

  const handleLogout = () => {
    navigate("/login");
  };

  const toggleSidebar = () => {
    setSidebarVisible(!isSidebarVisible);
  };

  const closeSidebar = () => {
    setSidebarVisible(false);
  };

  const handleMouseEnter = (module) => {
    setIsHovered((prev) => ({ ...prev, [module]: true }));
  };

  const handleMouseLeave = (module) => {
    setIsHovered((prev) => ({ ...prev, [module]: false }));
  };

  return (
    <div className="home-container">
      {!isSidebarVisible && (
        <button onClick={toggleSidebar} className="menu-toggle">
          <FaBars />
        </button>
      )}

      {isSidebarVisible && (
        <aside className="sidebar">
          <h2 className="sidebar-title" onClick={closeSidebar}>
            Placement Portal
          </h2>
          <nav className="sidebar-menu">
            <a onClick={() => navigate("/user-profile")}>
              <FaUser /> User Profile
            </a>
            <a onClick={() => navigate("/apply-jobs")}>
              <FaClipboardList /> Apply for Jobs
            </a>
            <a onClick={() => navigate("/my-applications")}>
              <FaBriefcase /> My Applications
            </a>
            <a onClick={() => navigate("/history")}>
              <FaHistory /> Application History
            </a>
          </nav>
          <button onClick={handleLogout}>
            <FaSignOutAlt /> Logout
          </button>
        </aside>
      )}

      <div className={`content-wrapper ${isSidebarVisible ? "shifted-content" : ""}`}>
        <header className="header">
          <h1>Welcome to the Placement Portal</h1>
        </header>

        <div className="main-content">
          <div className="modules">
            <div
              className="module-card"
              onMouseEnter={() => handleMouseEnter("jobListings")}
              onMouseLeave={() => handleMouseLeave("jobListings")}
              onClick={() => navigate("/job-listings")}
            >
              <FaClipboardList />
              <p>Job Listings</p>
              {isHovered["jobListings"] && <img src={bookGif} alt="Job Listings" />}
            </div>
            <div
              className="module-card"
              onMouseEnter={() => handleMouseEnter("resources")}
              onMouseLeave={() => handleMouseLeave("resources")}
              onClick={() => navigate("/resources")}
            >
              <FaBriefcase />
              <p>Resources</p>
              {isHovered["resources"] && <img src={notesGif} alt="Resources" />}
            </div>
          </div>

          <h2>Placement Resources</h2>
          <div className="resource-grid">
            {resources.map((resource) => (
              <div key={resource.id} className="resource-card">
                <img src={resource.coverPhotoUrl} alt="Resource Cover" />
                <h3>{resource.title}</h3>
                <button onClick={() => navigate(`/resource/${resource.id}`)}>View Details</button>
              </div>
            ))}
          </div>
        </div>
      </div>
    </div>
  );
};

export default UserHome;
